import React from 'react'
import Base from './re_usable/Base'
import { Redirect } from 'react-router-dom'
import {isAuthenticated} from './auth/helper/auth_helper'

export default function Home() {

    if(!isAuthenticated){
        <Redirect to='/signin'/>
    }

    return (
        <Base title='API'>
            <p></p>
        </Base>
    )
}
